import React, { useState } from "react";

export default function Counter(){
    const [count, setCount] = useState(0);

    function add(){
       return( setCount + 1 )
    }
return(
    <div id="countCont">
        <div id="countNumber">{count}</div>
        <button id="adder" onClick={add} >+</button>
        <button id="subtracter">-</button>
    </div>
)
}
